export async function verify_google_email(
  header: BoundedVec,
  pubkey: RSAPubkey,
  signature: Field[],
  from_header_sequence: Sequence,
  from_address_sequence: Sequence,
  to_header_sequence: Sequence,
  to_address_sequence: Sequence,
  foreignCallHandler?: ForeignCallHandler
): Promise<VerifiedOutputs> {
  const program = new Noir(verify_google_email_circuit);
  const args: InputMap = {
    header,
    pubkey,
    signature,
    from_header_sequence,
    from_address_sequence,
    to_header_sequence,
    to_address_sequence,
  };
  const { returnValue } = await program.execute(args, foreignCallHandler);
  return returnValue as VerifiedOutputs;
}
